import styled from 'styled-components';

const Link = styled.div`
  position: absolute;
  bottom: 4px;
  left: 38px;
  font-weight: 400;
  color: #007eff;
  cursor: pointer;
  font-size: 13px;
  svg {
    margin-right: 7px;
    font-size: 11px;
  }
`;

export default Link;
